import React from 'react';
import './Section.scss';

const Section = ({ title, posts, size = 'small' }) => {
    const cls = ['section__posts'];
    size && cls.push(`post__${size}`);
    return (
        <section className='section'>
            <div className='container'>
                <div className='section__title'>Articles</div>
                <div className={cls.join(' ')}>
                    <div className='post__title'>
                        Fresh Challenges in a New Recruitment Paradigm
                    </div>
                    <div className='post__img'></div>
                </div>
            </div>
        </section>
    );
};

export default Section;
